INSERT INTO `addon` (`id`, `company_id`, `name`, `description`, `notes`, `image`, `amount_recurring`, `taxable`, `show`, `sku`, `soc_code`, `bot_code`, `created_at`, `updated_at`) VALUES
(1, 1, 'International Calling', '<p class=\"add-bottom-3 t-gray-2 f12 add-top-2\">Add the Stateside International Calling feature to your solution, and get:</p>\n									<ul class=\"add-bottom-3 t-gray-2 f12\">\n										<li><span class=\"t-violet-2\">+</span> Unlimited mobile-to-landline calling to 70+ countries</li>\n										<li><span class=\"t-violet-2\">+</span> Unlimited mobile-to-mobile calling to 30+ countries</li>\n										<li><span class=\"t-violet-2\">+</span> Calls to other countries at a reduced rate</li>\n									</ul>\n									<p class=\"add-bottom-3 t-gray-2 f12\">See a complete list of included countries <a target=\"_blank\" href=\"https://www.t-mobile.com/optional-services/international-calling-mobile-countries.html\" class=\"t-violet-2\">HERE</a>. (The top list includes all countries that allow calls to landline and mobile numbers, the bottom list includes countries that allow only calls to landlines.)</p>\n									<p class=\"add-bottom-3 t-gray-2 f12\">Please visit our FAQ page for more details about this feature. (<span class=\"t-violet-2\">Support</span> &gt; <span class=\"t-violet-2\">Features</span> &gt; <span class=\"t-violet-2\">Stateside International Calling</span>)</p>', '', '', 20, 0, 0, '', '', '', NULL, NULL),
(2, 2, 'test company2 addon', '', '', '', 0, 0, 0, '', '', '', NULL, NULL),
(3, 1, 'Name ID', '<p class=\'add-bottom-3 t-gray-2 f12 add-top-2\'>This service shows you the names in addition to the phone numbers of your callers, even if they\'re not in your address book.</p>', '', '', 5, 0, 0, '', '', '', NULL, NULL);
